INSERT INTO `catalog_pages` VALUES ('4', '3', 'Tapizados', '1', '0', '1', '1', '55', '1', 'spacepage', 'look_feel_text', '', 'Suelos, pinturas, vistas... Encuentra la mejor combinación y utiliza nuestra Sala virtual para experimentar con los colores que te gustan antes de comprarlos para tu Sala.', '', '', '', '', '0', '0');
INSERT INTO `catalog_pages` VALUES ('5', '3', 'Iluminación', '1', '0', '1', '1', '40', '1', 'defaultpage', 'catalog_dimmers_header1_es', 'dimmers_teaser', '¡Dale un vuelco a la iluminación de tu Sala simplemente pulsando un Interruptor o el Panel de Fusibles!', '', '', '', '', '0', '3');
INSERT INTO `catalog_pages` VALUES ('6', '3', 'Ventanas', '1', '0', '1', '1', '63', '0', 'defaultpage', 'ctlg_windows_headline1_es', 'ctlg_windows_teaser1_es', '¡Deja que la luz entre en tu Sala! Tienes ventanas de diferentes estilos para darle un toque único', '', 'Selecciona:', 'catalog_special_txtbg2', '¡Pedazo de vista!', '0', '1');
INSERT INTO `catalog_pages` VALUES ('7', '2', 'Regalos HC', '1', '0', '1', '1', '75', '1', 'club_gifts', 'hc2_clubtitle', '', 'Echa un vistazo a los regalos HC y VIP. Si eres HC, podrás elegir entre una selección de regalos HC. Si eres VIP, entre una selección de regalos VIP.', '', '', '', '', '0', '1');
INSERT INTO `catalog_pages` VALUES ('8', '3', 'Mode', '1', '0', '1', '1', '39', '0', 'defaultpage', 'catalog_mode_headline1', 'catalog_mode_teaser1', '¿Funcionalidad y diseño en uno? Estos Furni están reservados a Habbos que se sienten intocables y seguros de sí mismos. ¿Tienes estilo o no?', '', 'Selecciona:', '', '¡Mira como brilla!', '0', '1');
INSERT INTO `catalog_pages` VALUES ('9', '-1', 'Tienda Píxel', '1', '1', '0', '1', '5', '5', 'defaultpage', '', '', '', '', '', '', '', '0', '5');
INSERT INTO `catalog_pages` VALUES ('10', '9', 'Efectos Especiales', '1', '0', '1', '1', '61', '1', 'defaultpage', 'catalog_pixeleffects_headline1_es', 'catalog_pxl_teaser1_es', '\'Tunea\' tu personaje según la ocasión con unos buenos efectos especiales. ¿Necesitas relucir en una visita de famosos? ¿Participar en una carrera de coches?', '', '', '', '', '0', '2');
INSERT INTO `catalog_pages` VALUES ('11', '9', 'Automóvil', '1', '0', '1', '1', '16', '1', 'defaultpage', 'catalog_automobile_header1_es', 'catalog_automobile_teaser1_es', '¡Todo Habbo merece disfrutar de un buen coche! ¿Y acaso puede haber un mejor regalo para un amigo que un bonito semáforo o una elegante pila de neumáticos?', '', '', '', '', '0', '3');
INSERT INTO `catalog_pages` VALUES ('12', '-1', 'Mascotas', '1', '0', '0', '1', '8', '7', 'defaultpage', '', '', '', '', '', '', '', '0', '4');
INSERT INTO `catalog_pages` VALUES ('13', '12', 'Perros', '1', '0', '1', '1', '24', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Hocicos peludos, zarpas y ladridos. ¡Estás a punto de entrar al mundo de los perros! Una adorable y fiel mascota te estará esperando siempre y meneará la cola en cuanto te vea. ¡Encuentra un nuevo amigo aquí mismo!', '', '', '', '', '0', '9');
INSERT INTO `catalog_pages` VALUES ('14', '12', 'Gatos', '1', '0', '1', '1', '20', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Pelusas, bigotes, maullidos y ronroneos. ¡Estás a punto de entrar en el mundo de los gatos! Estas pequeñas y peludas criaturas te darán la mejor de las compañías siempre que cuides de ellas. ¡Encuentra aquí mismo a tu nuevo amigo!', '', '', '', '', '0', '10');
INSERT INTO `catalog_pages` VALUES ('15', '12', 'Cocodrilos', '1', '0', '1', '1', '22', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Piel áspera, gruñidos y una dentadura de acero. ¡Estás a punto de entrar en el mundo de los cocodrilos! La mejor manera de poner los pelos de punta a tus amigos la tienes si te haces con uno de mascota. ¿A qué esperas para hacerlo?', '', '', '', '', '0', '11');
INSERT INTO `catalog_pages` VALUES ('16', '12', 'Osos', '1', '0', '1', '1', '68', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Éste es un largo y pesado mamífero que camina sobre la planta de sus pies y cuenta con una gruesa piel. La mayorí­a de los osos son omní­voros, tenlo en cuenta a la hora de alimentarle. Enamórate de la gran variedad que aquí­ te presentamos, desde Grizzlies a Osos Polares.', '', '', '', '', '0', '8');
INSERT INTO `catalog_pages` VALUES ('17', '12', 'Terrier', '1', '0', '1', '1', '66', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Una de las razas más antiguas de perros es la de los Terrier. Originales de las altas montañas de Escocia, son reconocidos como unos de los primeros perros utilizados como fuerza de trabajo debido a su capacidad para seguir rastros.', '', '', '', '', '0', '7');
INSERT INTO `catalog_pages` VALUES ('18', '12', 'Jabalíes', '1', '0', '1', '1', '67', '0', 'petpage', 'catalog_pet_headline1_es', '', 'El Jabalí es una especia salvaje de cerdo, e incluye al menos hasta 16 subespecies.', '', '', '', '', '0', '6');
INSERT INTO `catalog_pages` VALUES ('19', '12', 'Rinocerontes', '1', '0', '1', '1', '77', '0', 'petpage', 'catalog_pet_headline1_es', '', 'El Rinoceronte es un herbívoro africano que puede llegar a pesar más de una tonelada. Quizá en la naturaleza sean de trato difícil, pero en Habbo son de lo más amistosos.', '', '', '', '', '0', '5');
INSERT INTO `catalog_pages` VALUES ('20', '12', 'Leones', '1', '0', '1', '1', '76', '0', 'petpage', 'catalog_pet_headline1_es', '', 'Fiero depredador en plena naturaleza, el león se ha vuelto manso para convertirse en tu fiel amigo en Habbo Hotel.', '', '', '', '', '0', '4');
INSERT INTO `catalog_pages` VALUES ('21', '12', 'Arañas', '1', '0', '1', '1', '95', '0', 'petpage', '', '', 'Su picadura es legendaria, pero no aconsejamos probarla. Hablamos de la Araña, una nueva Mascota que ya puede hacerte compañí­a en tu Sala... si no le tienes miedo.', '', '', '', '', '0', '3');
INSERT INTO `catalog_pages` VALUES ('22', '12', 'Ranas', '1', '0', '1', '1', '97', '0', 'petpage', 'catalog_pet_headline1_es', '', '¿Cuentas con una buena charca en una de tus Salas Privadas? Entonces no puede faltar en ella una de las Ranas que aquí­ te presentamos. ¿Con cuál te quedas?', '', '', '', '', '0', '2');
INSERT INTO `catalog_pages` VALUES ('23', '12', 'Pollitos', '1', '0', '1', '1', '107', '0', 'petpage', 'catalog_easter_teaser1', '', '¡Habbo Hotel se ha llenado de Pollitos! Adopta tu ejemplar y comienza a entrenarlo desde ya mismo. ¿Conseguirás que haga el Baile del Pollito en cuestión de horas?', '', '', '', '', '0', '1');
INSERT INTO `catalog_pages` VALUES ('24', '12', 'Dragones', '1', '0', '1', '1', '109', '0', 'petpage', 'catalog_pet_headline1_es', '', '¿List@ para permitir unas cuantas llamaradas en tu Sala? Hazte con cualquiera de las razas de Dragones que puedes ver aquí­ a golpe de clic.', '', '', '', '', '0', '0');
INSERT INTO `catalog_pages` VALUES ('25', '-1', 'Wired Furni', '1', '0', '0', '1', '80', '1', 'defaultpage', '', '', '', '', '', '', '', '0', '3');
INSERT INTO `catalog_pages` VALUES ('26', '32', 'Battle Banzai', '1', '0', '1', '1', '78', '9', 'defaultpage', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', '¿Más grande? ¿Mejor? ¡Banzai! Ahora tú eres quien decide las reglas de tu propio juego de Bttle Banzai, el que montes en una de tus Salas Privadas. ¡Tú tienes el poder!', '', '', '', '', '0', '7');
INSERT INTO `catalog_pages` VALUES ('27', '25', 'Series', '1', '0', '1', '1', '84', '5', 'defaultpage', 'catalog_wired_header6_es', 'ctlg_pic_wired_deals', '¡La forma más fácil de sacar partido a los Furni Wired es a través de las series! Cada una de ellas contiene todos los Furni necesarios para dar lugar a una acción específica, como \'Puertas con contraseña\'.¡Haz clic en cada serie para ver qué contiene!', '', '', '', '', '0', '0');
INSERT INTO `catalog_pages` VALUES ('28', '25', 'Causantes', '1', '0', '1', '1', '81', '5', 'defaultpage', 'catalog_wired_header2_es', 'ctlg_pic_wired_triggers', 'Los Causantes permiten definir qué se necesita que pase para que tenga lugar un Efecto. Para programar un Causante, colócalo en una Sala, haz doble clic en él y ponlo en marcha. Necesitarás apilar un Efecto sobre un Causante.', '', '¡Haz clic en cada objeto para ver cómo funciona!', '', '', '0', '1');
INSERT INTO `catalog_pages` VALUES ('29', '25', 'Efectos', '1', '0', '1', '1', '82', '5', 'defaultpage', 'catalog_wired_header3_es', 'ctlg_pic_wired_effects', 'Los Efectos son lo que sucede después de haber activado un Causante. Para programar un Efecto, colócalo en una Sala, haz doble clic en él y ponlo en marcha. Necesitarás siempre apilar un Causante sobre un Efecto.', '', '¡Haz clic en cada objeto para ver lo que hace cada Efecto!', '', '', '0', '2');
INSERT INTO `catalog_pages` VALUES ('30', '25', 'Condiciones', '1', '0', '1', '1', '83', '5', 'defaultpage', 'catalog_wired_header4_es', 'ctlg_pic_wired_conditions', 'Las Condiciones son determinados criterios que deben ser especificados antes de que el Causante se ponga en marcha. Si quieres usar una Condición, deberás apilarla sobre un Causante y un Efecto.', '', '¡Haz clic en cada objeto para ver cómo funcionan las Condiciones!', '', '', '0', '3');
INSERT INTO `catalog_pages` VALUES ('31', '25', 'Complementos', '1', '0', '1', '1', '85', '5', 'defaultpage', 'catalog_wired_header5_es', 'ctlg_pic_wired_support_furniture', 'Utiliza estos Furni simplemente para dar algo más de sabor a tu Sala Wired. Necesitarás apilar un Complemento sobre un Causante, un Efecto y una Condición para que funcione.', '', '¡Haz clic en cada objeto para ver de qué van los Complementos!', '', '', '0', '4');
INSERT INTO `catalog_pages` VALUES ('32', '-1', 'Juegos', '1', '0', '0', '1', '84', '1', 'defaultpage', '', '', '', '', '', '', '', '0', '2');
INSERT INTO `catalog_pages` VALUES ('33', '32', 'Reglas Banzai', '1', '0', '1', '1', '42', '0', 'instructions', 'catalog_battleBanzai_header_en', 'icon_78', 'Lee las instrucciones y descubre cómo jugar al Battle Banzai. ¡No hay tiempo que perder!', '', '¿Cómo crear tu propia Sala de Battle Banzai?{separe}1. Ve a tu Sala|2. Coloca casillas Banzai en el suelo y vallas para limitar el campo de juego|3. Añade un Vestuario Banzai en cada lado para cada equipo. Hay cuatro opciones: azul, rojo, amarillo y verde|4. Coloca el Contador y los Marcadores en el terreno de juego|5. Una vez esté todo listo, di a tus amigos que se preparen|6. Haz clic en el Contador e inicia el juego', '', '', '0', '8');
INSERT INTO `catalog_pages` VALUES ('34', '32', 'Fútbol', '1', '0', '1', '1', '56', '0', 'defaultpage', 'catalog_football_001', 'football_teaser', 'El deporte rey no podía faltar en Habbo y es hora de que demuestres que con el balón en los pies no hay rival al que no puedas batir.', '', '', '', '', '0', '9');
INSERT INTO `catalog_pages` VALUES ('35', '32', 'Reglas Fútbol', '1', '0', '1', '1', '42', '0', 'instructions', 'catalog_football_001', 'icon_56', 'Monta un campo y coloca en sus laterales tantos Vestuarios como equipos quieras que participan en el juego. Ah, y no te olvides del Balón, claro. ¡Dominar este juego no lleva mucho tiempo!', '¿Sabías que las mascotas también pueden jugar? ¡Haz la prueba!', 'Aquí­ tienes algunos consejos:{separe}1. Haz un disparo avanzando hasta la casilla en la que está el Balón, o da un pase atravesando esa misma casilla.|2. Hazte con el control del balón avanzando hasta una casilla junto a este y luego haciendo doble clic sobre él.|3. Haz que rebote el Balón ante obstáculos como otros Furni, jugadores o vallas.', '', '', '0', '10');
INSERT INTO `catalog_pages` VALUES ('36', '32', 'Freeze', '1', '0', '1', '1', '87', '0', 'defaultpage', 'catalog_freeze_en', 'ctlg_teaser_es', 'Seguro que después de participar en este juego ya no te gusta tanto la nieve... Compite por equipos y consigue que impacten el mayor número de bolas de nieve posibles sobre tus contrincantes. ¡Son como auténticas bombas!', '', '', '', '', '0', '5');
INSERT INTO `catalog_pages` VALUES ('37', '32', 'Reglas Freeze', '1', '0', '1', '1', '42', '0', 'instructions', 'catalog_freeze_en', 'ctlg_teaser_es', 'Descubre aquí­ cómo crear un recinto donde poder jugar a \'Freeze\' y, además, cómo jugar exactamente.', 'Recuerda: ¡pon siempre los Bloques sobre una Casilla Freeze! Si no, no funcionarán.', '¡Así­ es como puedes crear tu propia partida!{separe}1. Ve a tu Sala.|2. Coloca Casillas y Bloques Freeze en el suelo y utiliza Paredes para delimitar el terreno de juego. ¡Pon siempre los Bloques sobre una Casilla!|3. Añade un acceso para cada equipo en tu Sala. Puede haber un máximo de cuatro equipos: amarillo, azul, rojo y verde.|4. Coloca un Contador y un Marcador en el terreno de juego.|5. Finalmente, coloca una Casilla de Salida fuera del terreno de juego. Ahí­ serán enviados los jugadores cuando ya no les quede ninguna vida.|6. ¿Listo? Llama a tus amigos y deja que elijan equipo. Cada uno puede tener hasta un máximo de cinco jugadores.|7. Haz clic en el Contador y deja que empiece el juego.', '', '', '0', '6');
INSERT INTO `catalog_pages` VALUES ('38', '32', 'Puzzles', '1', '0', '1', '1', '99', '0', 'defaultpage', 'puzzlebox_headline1', 'puzzlebox_teaser1', 'Dificulta el tipo de laberintos que construyes incluyendo Furni que te permitirá crear incluso puzzles en los que, para conseguir abrir una puerta, antes tengas que desplazar una Caja hasta un lugar concreto.', '', '', '', '', '0', '3');
INSERT INTO `catalog_pages` VALUES ('39', '32', 'Reglas Puzzles', '1', '0', '1', '1', '42', '0', 'instructions', 'puzzlebox_headline1', 'icon_99', 'Este tipo de Furni te ayudará a crear complicados laberintos. Simplemente habrá que situarse junto a una Caja y hacer doble clic sobre ella para empujarla.', '', 'Cómo usar la Caja para Puzzles:{separe}1. Compra el Divisor para Puzzles + varias Cajas para Puzzles y construye un laberinto.|2. Emplea la Condición WIRED \'Furni encima\' junto a Casillas de Presión, y así­ cuando las Cajas se empujen hacia unos lugares concretos, varias puertas podrí­an abrirse, por ejemplo.|3. Deja que tus amigos prueben el laberinto. Para mover las Cajas deberán hacer clic sobre ellas en varias direcciones hasta encontrar un camino para salir del laberinto.', '', '', '0', '4');
INSERT INTO `catalog_pages` VALUES ('40', '32', 'Patinaje sobre Ruedas', '1', '0', '1', '1', '94', '0', 'defaultpage', 'catalog_header_bling_en', 'catalog_teaser_rollerblades', '', '', '', '', '', '0', '2');
INSERT INTO `catalog_pages` VALUES ('41', '32', '¡Tú la llevas!', '1', '0', '1', '1', '88', '0', 'defaultpage', 'catalog_tag_br', 'catalog_teaser_xm10_skate', 'Crea tu propio juego de \'tú la llevas\', \'pega-pega\' o \'pilla-pilla\'. Para ponerte los patines basta con pisar el Hielo, pero para el juego, necesitas que también haya una Luz de Salida sobre el Hielo.', '', '', '', '', '0', '1');
INSERT INTO `catalog_pages` VALUES ('42', '32', 'Conejo Veloz', '1', '0', '1', '1', '108', '0', 'defaultpage', 'catalog_easter_headline1_es', 'bunnyrun_teaser', '¿Estás listo para el juego que transcurre a mayor velocidad en Habbo? Coloca todos los Céspedes para Conejos que quieras y, al menos, una Luz para Conejos sobre ellos para iniciar la partida.', '', '', '', '', '0', '0');
INSERT INTO `catalog_pages` VALUES ('43', '-1', 'Furnis por Objetos', '1', '0', '0', '1', '121', '1', 'defaultpage', '', '', '', '', '', '', '', '0', '1');
INSERT INTO `catalog_pages` VALUES ('44', '-1', 'Top Ventas', '1', '0', '1', '1', '64', '3', 'bestsellers', 'catalog_bestsellers_header_en', 'catalog_teaser_bestsellers', 'Aquí podrás encontrar cuáles han sido los objetos que mejor se han vendido en la última semana. ¡Recuerda echar un vistazo regularmente para saber cuáles son los objetos a la venta más apreciados!', '', '', '', '', '0', '0');
INSERT INTO `catalog_pages` VALUES ('45', '-1', 'Novedades', '1', '0', '1', '1', '64', '5', 'news', 'catalog_new_header_en', 'catalog_teaser_new', 'Aquí­ puedes encontrar los últimos objetos que han llegado a Habbo a lo largo del último par de semanas. ¡Recuerda echar un vistazo de forma regular para ver qué hay de nuevo en el Hotel!', '', '', '', '', '0', '0');
INSERT INTO `catalog_pages` VALUES ('46', '-1', 'Raros', '1', '0', '1', '1', '3', '1', 'defaultpage', 'catalog_cltbs_header1_es', 'catalog_cltbs_teaser_es', 'Los Raros coleccionables son Furni especial que se vende sólo por un breve espacio de tiempo. Aumentan tu poder de cambio y lucen como ningún otro objeto en tus Salas.', '', '', '', '', '0', '0');
