INSERT INTO `catalog_pages` VALUES ('48', '-1', 'Habbo Cambio', '1', '0', '1', '1', '6', '11', 'defaultpage', 'catalog_bank_headline1_es', 'catalog_bank_teaser', 'Convierte tus Créditos en una moneda especial tradeable. Así­, no sólo podrás intercambiar Furni, sino también comprarlos mientras tradeas. Nota: ten en cuenta que una cosa es el valor y otra el precio al que compras cada pieza.', '', '', '', '', '0', '5');
