INSERT INTO `catalog_pages` VALUES ('51', '-1', 'Descuentos', '1', '0', '1', '1', '10', '7', 'defaultpage', 'catalog_deals_headline1_es', 'catalog_deals_teaser1', 'Bienvenido todo el mundo a nuestra sección especial de ofertas. ¡Mira todo lo que hay dentro de esas cajas! ¡Echa un vistazo! Ve a la noticia de la web para ver exactamente el contenido de cada caja. Haz clic en una de ellas para ver cuánto cuesta. Hmm, ¿qué hay de nuevo hoy?', '', '', '', '', '0', '10');
