INSERT INTO `catalog_pages` VALUES ('54', '12', 'Tortuga', '1', '0', '1', '1', '126', '1', 'petpage', 'catalog_pet_headline1_es', '', 'Ha sido suficiente con oír que en Habbo tenemos unas olas fabulosas y un mar transparente para que una nueva Mascota haya asomado su cabeza en el hotel: ¡La tortuga!', '', '', '', '', '0', '-1');
INSERT INTO `catalog_pages` VALUES ('55', '12', 'Caballo', '1', '0', '1', '1', '132', '1', 'petpage', 'catalog_horse_header1_es', '', 'Cabalga por el Hotel a lomos de tu Caballo. Para poder subirte debes hacerte primero con una Montura. También podrás customizar el color de su piel y el de su melena. Ah, ¡y no te olvides de todos los accesorios!', '', '', '', '', '0', '-4');
INSERT INTO `catalog_pages` VALUES ('56', '47', 'Jukebox', '1', '0', '1', '1', '4', '1', 'defaultpage', 'catalog_djshop_headline1', 'catalog_djshop_teaser1', '¡Es hora de divertirse! Coloca una Jukebox en una de tus Salas, añade varios discos de la sección \'Habbo Hotel Hits\' a la misma y ya lo tendrás todo listo para montar un gran fiestón.', '', '', '', '', '0', '0');
INSERT INTO `catalog_pages` VALUES ('57', '47', 'Habbo Hotel Hits', '1', '0', '1', '1', '4', '1', 'musicshop', 'catalog_djshop_headline1', 'catalog_djshop_teaser1', '¡Sube el volumen y saca partido a los nuevos discos que se pueden escuchar en tus Salas! Coloca una Jukebox, hazte con las canciones que desees y añadelas a la Lista de Reproducción.', '', '¡Escucha previa en una Sala!', '', '', '0', '1');
INSERT INTO `catalog_pages` VALUES ('58', '3', 'Anna', '1', '0', '1', '1', '104', '1', 'defaultpage', 'catalog_anna_header', 'catalog_anna_teaser', 'Decora con estilo tus Salas gracias a los Furni que puedes encontrar en esta sección.', '', '', '', '', '0', '8');
INSERT INTO `catalog_pages` VALUES ('59', '3', 'Área', '1', '0', '1', '1', '14', '1', 'defaultpage', 'catalog_area_headline1_br', 'catalog_area_teaser1', 'Clásicos, cómodos y sencillos. Si no quieres romperte la cabeza, usa estos Furni.', '', '', '', '', '0', '5');
INSERT INTO `catalog_pages` VALUES ('60', '3', 'Pura', '1', '0', '1', '1', '48', '1', 'defaultpage', 'catalog_pura_headline', 'catalog_special_txtbg1', 'Aquí­ tienes unos muebles de lí­neas y colores puros. ¡Relájate!', '', '', '', '', '0', '4');
INSERT INTO `catalog_pages` VALUES ('61', '3', 'Cubie', '1', '0', '1', '1', '100', '1', 'defaultpage', 'catalog_cubie_header_en', 'catalog_cubie_teaser', 'Hemos hecho una gran apuesta por el diseño y por varios Furni modulares que incluso se pueden apilar. ¿A qué esperas para probarlos?', '', '', '', '', '0', '8');
INSERT INTO `catalog_pages` VALUES ('62', '3', 'Waasa', '1', '0', '1', '1', '103', '1', 'defaultpage', 'waasa_catalogue_header', 'waasa_teaser', 'Deja volar la imaginación y vive grandes aventuras de la mano de los Furni Waasa.', '', '', '', '', '0', '8');
INSERT INTO `catalog_pages` VALUES ('63', '3', 'Rústico', '1', '0', '1', '1', '37', '1', 'defaultpage', 'catalog_lodge_headline1_es', 'catalog_lodge_teaser1', '¡De pura cepa! Aquí­ encontrarás Furni de madera que darán a tu Sala un aire muy especial y verdaderamente cálido.', '', '', 'catalog_special_txtbg2', '', '0', '4');
