INSERT INTO `catalog_pages` VALUES ('67', '43', 'Asientos', '1', '0', '1', '1', '111', '1', 'categorized', 'catalog_chairs_header_dyn', 'catalog_chairs_teaser2_001', 'Claro que necesitamos unos buenos asientos en los que descansar después de una ajetreada jornada en Habbo. ¡Aquí­ los tienes de todos los tipos!', '', '', '', '', '0', '0');
INSERT INTO `catalog_pages` VALUES ('68', '43', 'Mesas', '1', '0', '1', '1', '112', '1', 'categorized', 'catalog_tables_header_dyn', 'catalog_tables_teaser2_001', 'Nada como una gran mesa donde exhibir los mejores manjares de los que disponemos. ¡Hazte con la tuya!', '', '', '', '', '0', '1');
INSERT INTO `catalog_pages` VALUES ('69', '3', 'Rollers', '1', '0', '1', '1', '96', '0', 'defaultpage', 'catalog_roller_headline1', 'catalog_teaser_rollers_es', 'Si con una simple palanca se puede mover el mundo, con un Habbo Roller pondrás patas arriba el ciberespacio entero. ¡Muévete, Habbo! ¡Muévete! (Sólo 35 por Sala).', '', '', '', '', '0', '5');
