INSERT INTO `catalog_pages` VALUES ('72', '12', 'Monturas', '1', '0', '1', '1', '135', '0', 'hs_saddles', 'catalog_saddles_header1_es', 'horse_teaser', 'Para usar una Montura, colócala primero en una Sala en donde haya al menos un Caballo. Luego clica en ella y selecciona a qué Caballo ponérsela. Finalmente, haz clic en el Caballo y selecciona \'Usar montura\'. ¡Así de fácil!', '', '', '', '', '0', '-3');
INSERT INTO `catalog_pages` VALUES ('73', '50', 'Mercadillo', '1', '0', '1', '1', '69', '0', 'instructions', 'catalog_marketplace_header_es', '', 'El Habbo Mercadillo es una forma segura y conveniente de comprar y vender objetos en Habbo', '', '¿Cómo funciona el Habbo Mercadillo?{separe}Vender objetos: |Puedes vender cualquiera que sea tradeable seleccionándolo en tu Inventario y haciendo clic en \'Vender en Mercadillo\', incluidos los que en ese momento estén a la venta en la Tienda, excepto Mascotas, Teleports y objetos comprados con Píxeles.||Comprar objetos:|Selecciona el objeto deseado entre las \'Ofertas\' y haz clic en \'Comprar\'.', '', '', '0', '0');
